import React from 'react';
import Grid from '@material-ui/core/Grid';
import styled from 'styled-components';

import Project from './Project/Project';

import portfolioData from './portfolioData/portfolioData';

const Portfolio = () => {

    const Wrapper = styled(Grid)`
        padding: 50px;
    `;

    const Title = styled.h1`
        font-size: 30px;
        color: #566366;
        margin: auto;
        margin-top: 30px;
    `;

    const Text = styled.p`
        color: #919191;
        font-size: 20px;
        text-align: center;
        padding: 0 50px 0 50px;

        @media (max-width: 600px){
            padding: 0 30px 0 30px;
        }
    `;

    const ProjWrapper = styled(Grid)`
        height: 30vh;
        margin: 10px;
    `;

    return(
        <Wrapper container>
            <Title>Portfolio</Title>
            <Text>Lorem ipsum dolor sit amet, ea doming epicuri iudicabit nam, te usu virtute placerat. Purto brute disputando cu est, eam dicam soluta ei. Vel dicam vivendo accusata ei, cum ne periculis molestiae pri. </Text>

            {portfolioData.map(data => {
                return (
                    <ProjWrapper key={Math.random()} item xs={12} sm={4}>
                        <Project 
                        image={data.image} 
                        title={data.title}
                        employer={data.employer}
                        link={data.link}/>
                    </ProjWrapper>
                );
            })}



        </Wrapper>
    )
}

export default Portfolio;
